import React from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate } from 'react-router-dom';
import Login from './components/Login/login';
import Dashboard from './components/Dashboard/dashboard';
import Order from './components/Order/order';
import About from './components/About/about';
import Customer from './components/Customer/customer';
import AddCustomer from './components/AddCustomer/addcustomer';


const ProtectedRoute: React.FC<{ children: JSX.Element }> = ({ children }) => {
    const token = localStorage.getItem('authToken');
    
    return token ? children : <Navigate to="/" replace />;
};

const App: React.FC = () => {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<Login />} />
                <Route path="/manageOrder" element={<ProtectedRoute><Dashboard /></ProtectedRoute>} />
                <Route path="/order" element={<ProtectedRoute><Order /></ProtectedRoute>} />
                <Route path="/manageCustomer" element={<ProtectedRoute><Customer /></ProtectedRoute>} />
                <Route path="/about" element={<ProtectedRoute><About /></ProtectedRoute>} />
                <Route path="/addCustomer" element={<ProtectedRoute><AddCustomer /></ProtectedRoute>} />
            </Routes>
        </Router>
    );
};

export default App;
